[{"location":"lib/#Library","page":"Library","title":"Library","text":"","category":"section"},{"location":"lib/#Index","page":"Library","title":"Index","text":"","category":"section"},{"location":"lib/","page":"Library","title":"Library","text":"Pages = [\"lib.md\"]","category":"page"},{"location":"lib/#Public-Interface","page":"Library","title":"Public Interface","text":"","category":"section"},{"location":"lib/","page":"Library","title":"Library","text":"Webviews\r\nWebview\r\nWindowSizeHint\r\nrun(::Webview)\r\nterminate\r\ndestroy\r\nwindow_handle\r\ntitle!\r\nresize!(::Webview)\r\nsizehint!(::Webview, ::WindowSizeHint)\r\nnavigate!\r\nhtml!\r\ninit!\r\neval!\r\nbind(::Function, ::Webview, ::AbstractString)\r\nunbind","category":"page"},{"location":"lib/#Webviews","page":"Library","title":"Webviews","text":"Webviews\n\nJulia wrappers for webview, a tiny cross-platform webview library.\n\n\n\n\n\n","category":"module"},{"location":"lib/#Webviews.Webview","page":"Library","title":"Webviews.Webview","text":"Webview(size=(1024, 768); title=\"\", debug=false, size_hint=WEBVIEW_HINT_NONE, unsafe_window_handle=C_NULL)\nWebview(width, height; kwargs...)\n\nCreate a new webview instance with size and title.\n\nIf debug is true, developer tools will be enabled (if the platform supports them).\nUNSAFE unsafe_window_handle can be an unsafe pointer to the platforms specific native window handle.\n\nIf it's non-null - then child WebView is embedded into the given parent window. Otherwise a new window is created. Depending on the platform, a GtkWindow, NSWindow or HWND pointer can be passed here.\n\n\n\n\n\n","category":"type"},{"location":"lib/#Webviews.WindowSizeHint","page":"Library","title":"Webviews.WindowSizeHint","text":"WindowSizeHint\n\nEnum to specify the window size hint. Values:\n\nWEBVIEW_HINT_NONE: Width and height are default size.\nWEBVIEW_HINT_MIN: Width and height are minimum bounds.\nWEBVIEW_HINT_MAX: Width and height are maximum bounds.\nWEBVIEW_HINT_FIXED: Window size can not be changed by a user.\n\n\n\n\n\n","category":"type"},{"location":"lib/#Base.run-Tuple{Webview}","page":"Library","title":"Base.run","text":"run(w::Webview)\n\nRun the webview event loop. Runs the main event loop until it's terminated. After this function exits, the webview is automatically destroyed.\n\n\n\n\n\n","category":"method"},{"location":"lib/#Webviews.terminate","page":"Library","title":"Webviews.terminate","text":"terminate(w::Webview)\n\nStops the main loop. It is safe to call this function from another other background thread.\n\nNote: This function is not working on macOS.\n\n\n\n\n\n","category":"function"},{"location":"lib/#Webviews.destroy","page":"Library","title":"Webviews.destroy","text":"destroy(w::Webview)\n\nDestroys the webview and closes the window along with freeing all internal resources.\n\n\n\n\n\n","category":"function"},{"location":"lib/#Webviews.window_handle","page":"Library","title":"Webviews.window_handle","text":"window_handle(w::Webview)\n\nUNSAFE An unsafe pointer to the webviews platform specific native window handle. When using GTK backend the pointer is GtkWindow pointer, when using Cocoa backend the pointer is NSWindow pointer, when using Win32 backend the pointer is HWND pointer.\n\n\n\n\n\n","category":"function"},{"location":"lib/#Webviews.title!","page":"Library","title":"Webviews.title!","text":"title!(w::Webview, title::AbstractString)\n\nSet the native window title.\n\n\n\n\n\n","category":"function"},{"location":"lib/#Base.resize!-Tuple{Webview}","page":"Library","title":"Base.resize!","text":"resize!(w::Webview, [size::Tuple{Integer, Integer}]; [hint::WindowSizeHint])\n\nSets the native window size.\n\n\n\n\n\n","category":"method"},{"location":"lib/#Base.sizehint!-Tuple{Webview, WindowSizeHint}","page":"Library","title":"Base.sizehint!","text":"sizehint!(w::Webview, hint::WindowSizeHint)\n\nSets the native window size hint.\n\n\n\n\n\n","category":"method"},{"location":"lib/#Webviews.navigate!","page":"Library","title":"Webviews.navigate!","text":"navigate!(w::Webview, url::AbstractString)\n\nNavigates webview to the given URL. URL may be a data URI, i.e. \"data:text/html,<html>...</html>\".\n\n\n\n\n\n","category":"function"},{"location":"lib/#Webviews.html!","page":"Library","title":"Webviews.html!","text":"html!(w::Webview, html::AbstractString)\n\nSet webview HTML directly.\n\n\n\n\n\n","category":"function"},{"location":"lib/#Webviews.init!","page":"Library","title":"Webviews.init!","text":"init(w::Webview, js::AbstractString)\n\nInjects JavaScript code at the initialization of the new page. Every time the webview will open a the new page - this initialization code will be executed. It is guaranteed that code is executed before window.onload.\n\n\n\n\n\n","category":"function"},{"location":"lib/#Webviews.eval!","page":"Library","title":"Webviews.eval!","text":"eval!(w::Webview, js::AbstractString)\n\nEvaluates arbitrary JavaScript code. Evaluation happens asynchronously, also the result of the expression is ignored. Use bind if you want to receive notifications about the results of the evaluation.\n\n\n\n\n\n","category":"function"},{"location":"lib/#Base.bind-Tuple{Function, Webview, AbstractString}","page":"Library","title":"Base.bind","text":"bind(f::Function, w::Webview, name::AbstractString)\n\nBinds a callback so that it will appear in the webview with the given name as a global async JavaScript function. Callback arguments are automatically converted from json to as closely as possible match the arguments in the webview context and the callback automatically converts and returns the return value to the webview.\n\nNote: The callback function must handle a Tuple as its argument.\n\n\n\n\n\n","category":"method"},{"location":"lib/#Webviews.unbind","page":"Library","title":"Webviews.unbind","text":"unbind(w::Webview, name::AbstractString)\n\nUnbinds a previously bound function freeing its resource and removing it from the webview JavaScript context.\n\n\n\n\n\n","category":"function"},{"location":"#Webviews.jl","page":"Webviews.jl","title":"Webviews.jl","text":"","category":"section"},{"location":"","page":"Webviews.jl","title":"Webviews.jl","text":"Julia wrappers for webview, a tiny cross-platform webview library.","category":"page"},{"location":"#Library-Index","page":"Webviews.jl","title":"Library Index","text":"","category":"section"},{"location":"","page":"Webviews.jl","title":"Webviews.jl","text":"Pages = [\"lib.md\"]","category":"page"}]
